这说起来容易做起来难，但工具就像 twiggy ，手动检查 LLVM-IR 可以帮助您找出哪些函数令人恐慌。 恐慌并不总是表现为 panic!() 宏调用. 它们隐含地来自许多结构，例如: 对超出范围索引的切片进行索引: my_slice[i] 如果除数为零，则 分得数 会惊慌失措: dividend / divisor 打开一个 Option 或者 Result : opt.unwrap() 或者 res.unwrap() 前两个可以体现为第三个。 索引可以用 my_slice.get(i) 操作。 分得数 可以 checked_div 调用。 现在我们只有一个案例可以应对。 打开一个 Option 或者 Result 没有恐慌有两种风格: 安全和不安全。 安全的方法是 abort 代替恐慌，当得出一个 None 或一个 Error : #[inline]
pub fn unwrap_abort<T>(o: Option<T>) -> T { use std::process; match o { Some(t) => t, None => process::abort(), }
} 最终，无论如何在 wasm32-unknown-unknown 的恐慌都会转化为 abort ，所以这给你相同的行为，并没有代码膨胀。 或者， unreachable 箱 提供不安全的 unchecked_unwrap 扩展方法 ，给到 Option 和 Result ， 它告诉 Rust 编译器 假定 ，那个 Option 是 Some 或者 Result 是 Ok 。 若它是未定义，则该假设不成立，会发生什么。只有真的 110%确定时，才去使用这种不安全的方法，而且编译器只是不够聪明看到它。 即使你沿着这条路走下去，你也应该有一个仍然进行检查的调试构建配置，并且只在发布版本中使用未经检查的操作。

