在上一章中，我们克隆了一个初始项目模板. 我们现在将修改该项目模板. 让我们开始删除 wasm-game-of-life/src/lib.rs 的 alert 导入 和 greet 函数，并用单元格的类型定义替换它们: #[wasm_bindgen]
#[repr(u8)]
#[derive(Clone, Copy, Debug, PartialEq, Eq)]
pub enum Cell { Dead = 0, Alive = 1,
} 重要的是我们拥有 #[repr(u8)] ，以便每个单元格表示为单个字节。 同样重要的是 Dead 代表 0 ，那个 Alive 是 1 ，这样我们就可以轻松地计算一个单元格的活邻居。 接下来，让我们定义宇宙(Universe)。 宇宙具有宽度和高度，以及长度为 width * height 的单元格向量。 #[wasm_bindgen]
pub struct Universe { width: u32, height: u32, cells: Vec<Cell>,
} 要访问 给定行和列 的单元格，我们将 行和列 转换为 单元格向量 的索引，如前所述: impl Universe { fn get_index(&self, row: u32, column: u32) -> usize { (row * self.width + column) as usize } // ...
} 为了计算单元格的下一个状态，我们需要计算 其邻居有多少 是活着的。 我们来写一个 live_neighbor_count 方法，做到这一点! impl Universe { // ... fn live_neighbor_count(&self, row: u32, column: u32) -> u8 { let mut count = 0; for delta_row in [self.height - 1, 0, 1].iter().cloned() { for delta_col in [self.width - 1, 0, 1].iter().cloned() { if delta_row == 0 && delta_col == 0 { continue; } let neighbor_row = (row + delta_row) % self.height; let neighbor_col = (column + delta_col) % self.width; let idx = self.get_index(neighbor_row, neighbor_col); count += self.cells[idx] as u8; } } count }
} live_neighbor_count 方法使用 deltas 和 modulo 来避免宇宙的边缘情况。 当应用 -1 的增量时，我们 添加 self.height - 1 ，然后让 modulo 做它的事，而不是试图减去 1 。 row 和 column 可以为 0 ，如果我们试图减去 1 ， 从他们来看，会有一个 无符号整数 下溢。 现在我们拥有了当前计算下一代所需的一切! 每个游戏的规则遵循 转换条件用 match 直接表达。 另外，因为我们希望 JavaScript 控制 tick 时间，我们将把这个方法放在一个 #[wasm_bindgen] 注释下，以便它暴露给 JavaScript。 /// 公有方法, 暴露给 JavaScript.
#[wasm_bindgen]
impl Universe { pub fn tick(&mut self) { let mut next = self.cells.clone(); for row in 0..self.height { for col in 0..self.width { let idx = self.get_index(row, col); let cell = self.cells[idx]; let live_neighbors = self.live_neighbor_count(row, col); let next_cell = match (cell, live_neighbors) { // 规则 1: 任何少于两个邻居的活细胞死亡，就好像是由于人口不足造成的一样。. (Cell::Alive, x) if x < 2 => Cell::Dead, // 规则 2: 任何一个有两个或三个邻居的活体细胞都能传到下一代。. (Cell::Alive, 2) | (Cell::Alive, 3) => Cell::Alive, // 规则 3: 任何居住着三个以上邻居的活细胞都会死亡，就好像是由于人口过剩。. (Cell::Alive, x) if x > 3 => Cell::Dead, // 规则 4:任何一个只有三个相邻的活细胞的死细胞都会变成活细胞，就像通过繁殖一样。. (Cell::Dead, 3) => Cell::Alive, // 所有其他单元格保持相同状态。 (otherwise, _) => otherwise, }; next[idx] = next_cell; } } self.cells = next; } // ...
} 到目前为止，宇宙的状态被表示为 单元格 的载体。 为了使这个可读，让我们实现一个基本的文本渲染器。 我们的想法是逐行将 Universe 写成文本，对于每个活着的单元格，打印 Unicode 字符 ◼️ ("黑色方格") 。 对于死单元格，我们将打印 ◻️ ("白色方格") 。 通过实现来自 Rust 标准库 的 Display trait ，我们可以添加一种面向用户, 格式化结构的方法。 这也会自动给我们一个 to_string 方法. use std::fmt; impl fmt::Display for Universe { fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { for line in self.cells.as_slice().chunks(self.width as usize) { for &cell in line { let symbol = if cell == Cell::Dead { "◻️" } else { "◼️" }; write!(f, "{}", symbol)?; } write!(f, "\n")?; } Ok(()) }
} 最后，我们定义一个构造函数，用一个有趣的 活单元格和死单元格 模式来初始化宇宙，以及 render 方法: /// Public methods, exported to JavaScript.
#[wasm_bindgen]
impl Universe { // ... pub fn new() -> Universe { let width = 64; let height = 64; let cells = (0..width * height) .map(|i| { if i % 2 == 0 || i % 7 == 0 { Cell::Alive } else { Cell::Dead } }) .collect(); Universe { width, height, cells, } } pub fn render(&self) -> String { self.to_string() }
} 有了这个，我们的生命游戏 Rust 实现的一半就完成了! 在 wasm-game-of-life 目录内，通过运行 wasm-pack build 重新编译为 WebAssembly。

