让我们添加一个按钮，来切换游戏是正在播放还是暂停。 index.html 的 <canvas> 上方添加按钮: <button id="play-pause"></button> 在 JavaScript 中，我们将进行以下更改: 跟踪最新调用 requestAnimationFrame 返回的标识符, 以便我们可以以此，调用 cancelAnimationFrame 来取消那个标识符动画。 单击播放/暂停按钮时，检查我们是否具有排队动画帧的标识符。 1.点击时，游戏当前正在播放，取消动画帧 renderLoop ，有效地暂停游戏. 2.点击时，当前暂停，若没有排队动画帧的标识符，我们想运行 requestAnimationFrame 恢复比赛。 因为 JavaScript 正在驱动 Rust 和 WebAssembly，这就是我们需要做的所有，不过我们不需要更改 Rust 源代码。 我们介绍一下 animationId 变量来跟踪 requestAnimationFrame 返回的标识符。 当没有排队的动画帧时，我们将此变量设置为 null 。 let animationId = null; // 这个函数与之前的一样, 除了把`requestAnimationFrame`的结果
// 分配到 `animationId`.
const renderLoop = () => { universe.tick(); drawCells(); drawGrid(); animationId = requestAnimationFrame(renderLoop);
}; 在任何时刻，我们都可以通过 animationId 检查游戏，来判断游戏是否暂停: const isPaused = () => { return animationId === null;
}; 现在，当点击 播放/暂停 按钮时，我们会检查游戏当前是暂停还是正在播放，要么继续播放 renderLoop 动画，要么取消下一个动画帧。 此外，我们更新按钮的文本图标，以反映按钮在下次单击时将执行的操作。 const playPauseButton = document.getElementById('play-pause'); const play = () => { playPauseButton.textContent = '⏸'; renderLoop();
}; const pause = () => { playPauseButton.textContent = '▶'; cancelAnimationFrame(animationId); animationId = null;
}; playPauseButton.addEventListener('click', event => { if (isPaused()) { play(); } else { pause(); }
}); 最后，我们直接调用 requestAnimationFrame(renderLoop) 用来启动之前的游戏及其动画， 但我们想用 play 替换它，以便按钮获得正确的初始文本图标。 // This used to be `requestAnimationFrame(renderLoop)`.
play(); 刷新 http://localhost:8080/ ，现在你应该可以通过点击按钮来暂停和恢复游戏!

