现在我们可以暂停游戏了，现在是时候添加通过点击它们来改变细胞的能力了。 切换单元格是将其状态从活动状态转换为死亡状态，或从死亡状态转换为活动状态: impl Cell { fn toggle(&mut self) { *self = match *self { Cell::Dead => Cell::Alive, Cell::Alive => Cell::Dead, }; }
} 要切换给定行和列的单元格状态，我们将行和列对转换为单元格向量的索引，并在该索引处的单元格上调用 toggle 方法: /// 公有方法 methods， 导出到 JavaScript.
#[wasm_bindgen]
impl Universe { // ... pub fn toggle_cell(&mut self, row: u32, column: u32) { let idx = self.get_index(row, column); self.cells[idx].toggle(); }
} 这个方法是在 impl 带有 #[wasm_bindgen] 注释的区块内，这样它就可以被 JavaScript 调用。 在 JavaScript 中，我们会监听 点击事件 <canvas> 元素，将 click事件 的页面 相对坐标转换为画布相对坐标， 然后转换为行和列，调用 toggle_cell 方法，最后重绘场景。 canvas.addEventListener('click', event => { const boundingRect = canvas.getBoundingClientRect(); const scaleX = canvas.width / boundingRect.width; const scaleY = canvas.height / boundingRect.height; const canvasLeft = (event.clientX - boundingRect.left) * scaleX; const canvasTop = (event.clientY - boundingRect.top) * scaleY; const row = Math.min(Math.floor(canvasTop / (CELL_SIZE + 1)), height - 1); const col = Math.min(Math.floor(canvasLeft / (CELL_SIZE + 1)), width - 1); universe.toggle_cell(row, col); drawCells(); drawGrid();
}); 再次刷新 http://localhost:8080/ ,您现在可以通过单击单元格，并切换其状态来绘制自己的模式. 您可以在 checkout chapter-two 分支 , 找到此实现的完整源代码.

