当我们研究如何加速我们的生命游戏渲染时，这个 FPS 计时器将非常有用。 我们首先添加一个 fps 对象到 wasm-game-of-life/www/index.js ： const fps = new class { constructor() { this.fps = document.getElementById('fps'); this.frames = []; this.lastFrameTimeStamp = performance.now(); } render() { // Convert the delta time since the last frame render into a measure // of frames per second. const now = performance.now(); const delta = now - this.lastFrameTimeStamp; this.lastFrameTimeStamp = now; const fps = (1 / delta) * 1000; // Save only the latest 100 timings. this.frames.push(fps); if (this.frames.length > 100) { this.frames.shift(); } // Find the max, min, and mean of our 100 latest timings. let min = Infinity; let max = -Infinity; let sum = 0; for (let i = 0; i < this.frames.length; i++) { sum += this.frames[i]; min = Math.min(this.frames[i], min); max = Math.max(this.frames[i], max); } let mean = sum / this.frames.length; // Render the statistics. this.fps.textContent = `
Frames per Second: latest = ${Math.round(fps)}
avg of last 100 = ${Math.round(mean)}
min of last 100 = ${Math.round(min)}
max of last 100 = ${Math.round(max)}
`.trim(); }
}(); 接着，在每次 renderLoop 迭代时，我们调用给 fps render 函数： const renderLoop = () => { fps.render(); //新 universe.tick(); drawGrid(); drawCells(); animationId = requestAnimationFrame(renderLoop);
}; 最后，别忘了添加 fps 元素到 wasm-game-of-life/www/index.html ，就在 <canvas> 上面： <div id="fps"></div> 并添加更好的 CSS 其格式： #fps { white-space: pre; font-family: monospace;
} 瞧！刷新 http://localhost:8080 ，现在我们有一个 FPS 计数器！

