有些人不喜欢等待，并且，如果每个动画帧不是发生仅一次宇宙嘀嗒(tick)，而是更喜欢九次。我们可以修改 wasm-game-of-life/www/index.js 的 renderLoop 函数，这很容易做到这一点： for (let i = 0; i < 9; i++) { universe.tick();
} 在我的机器上，这使我们恢复到每秒 35 帧。不好。我们想要那个大大滴 60！ 现在我们知道时间花在了 Universe::tick ，所以让我们添加一些 Timer ，用 console.time 和 console.timeEnd 调用来包装它的各个部分，然后，看看它引导我们的地方。我假设啊，是分配一个新的单元格向量(vector)，后在每次 tick，就要释放旧向量是昂贵的，占用了我们时间预算的很大一部分。 pub fn tick(&mut self) { let _timer = Timer::new("Universe::tick"); let mut next = { let _timer = Timer::new("allocate next cells"); self.cells.clone() }; { let _timer = Timer::new("new generation"); for row in 0..self.height { for col in 0..self.width { let idx = self.get_index(row, col); let cell = self.cells[idx]; let live_neighbors = self.live_neighbor_count(row, col); let next_cell = match (cell, live_neighbors) { // Rule 1: Any live cell with fewer than two live neighbours // dies, as if caused by underpopulation. (Cell::Alive, x) if x < 2 => Cell::Dead, // Rule 2: Any live cell with two or three live neighbours // lives on to the next generation. (Cell::Alive, 2) | (Cell::Alive, 3) => Cell::Alive, // Rule 3: Any live cell with more than three live // neighbours dies, as if by overpopulation. (Cell::Alive, x) if x > 3 => Cell::Dead, // Rule 4: Any dead cell with exactly three live neighbours // becomes a live cell, as if by reproduction. (Cell::Dead, 3) => Cell::Alive, // All other cells remain in the same state. (otherwise, _) => otherwise, }; next[idx] = next_cell; } } } let _timer = Timer::new("free old cells"); self.cells = next;
} 看看时间，很明显我的假设是不正确的：绝大部分时间，实际花在计算下一代单元格上。令人惊讶的是，在每次 tick 上分配和释放向量，似乎具有可忽略的成本。分析记录是始终指导我们工作的提醒！ Screenshot of a Universe::tick timer results 下一节需要 nightly 编译器。它是必需的，因为 测试 feature(特性) 我们准备用于基准测试。我们将安装的另一个工具是 Cargo benchcmp 。它是一个小实用程序，用于比较 cargo bench 生成的微基准测试。 一个 #[bench] 原生代码，就做了我们 WebAssembly 正在做的事情，但我们可以使用更成熟的分析工具。这是新的 wasm-game-of-life/benches/bench.rs ： #![feature(test)] extern crate test;
extern crate wasm_game_of_life; #[bench]
fn universe_ticks(b: &mut test::Bencher) { let mut universe = wasm_game_of_life::Universe::new(); b.iter(|| { universe.tick(); });
} 我们还要注释所有的 #[wasm_bindgen] 标示，和来自 Cargo.toml 的 "cdylib" ，不然，构建本机代码将失败并出现链接错误。 有了这一切，我们就可以运行了 cargo bench | tee before.txt 编译并运行我们的基准测试！ | tee before.txt 部分将从 cargo bench 中获取输出，并放入一个名为 before.txt 的文件。 $ cargo bench | tee before.txt Finished release [optimized + debuginfo] target(s) in 0.0 secs Running target/release/deps/wasm_game_of_life-91574dfbe2b5a124 running 0 tests test result: ok. 0 passed; 0 failed; 0 ignored; 0 measured; 0 filtered out Running target/release/deps/bench-8474091a05cfa2d9 running 1 test
