} 我们使用 modulo 的原因是为了避免使代码混乱， if 出第一行或最后一行/列的边缘情况分支。但，当我们不在宇宙的边缘 row 或 column 的时候，不需要 modulo 包裹处理，会为此最常见情况的 div 命令付出代价。相反，如果我们使用 if 出边缘情况，并展开此循环，CPU 的分支预测器 应该 可以很好地预测它。 我们改写 live_neighbor_count ，像这样： fn live_neighbor_count(&self, row: u32, column: u32) -> u8 { let mut count = 0; let north = if row == 0 { self.height - 1 } else { row - 1 }; let south = if row == self.height - 1 { 0 } else { row + 1 }; let west = if column == 0 { self.width - 1 } else { column - 1 }; let east = if column == self.width - 1 { 0 } else { column + 1 }; let nw = self.get_index(north, west); count += self.cells[nw] as u8; let n = self.get_index(north, column); count += self.cells[n] as u8; let ne = self.get_index(north, east); count += self.cells[ne] as u8; let w = self.get_index(row, west); count += self.cells[w] as u8; let e = self.get_index(row, east); count += self.cells[e] as u8; let sw = self.get_index(south, west); count += self.cells[sw] as u8; let s = self.get_index(south, column); count += self.cells[s] as u8; let se = self.get_index(south, east); count += self.cells[se] as u8; count
} 现在让我们再次运行基准测试！这次输出到 after.txt 。 $ cargo bench | tee after.txt Compiling wasm_game_of_life v0.1.0 (file:///home/fitzgen/wasm_game_of_life) Finished release [optimized + debuginfo] target(s) in 0.82 secs Running target/release/deps/wasm_game_of_life-91574dfbe2b5a124 running 0 tests test result: ok. 0 passed; 0 failed; 0 ignored; 0 measured; 0 filtered out Running target/release/deps/bench-8474091a05cfa2d9 running 1 test
